    // calculates the sigmoid function
    private double sigmoid(double a){
        return 1.0/(1.0+Math.exp(-a));
    }
    //this method is a simplified forward propagation method, specific only to the structure of this neural network
    private double[] nnGetMove(int[] input){
        //first layer
        double[] output = new double[layer1.length];
        double product = 0.0;
        //calculate the output of each node in the hidden layer
        for(int i=0;i<layer1.length;i++){
            product = layer1[i][0];
            for(int j=1;j<layer1[i].length;j++){
                product = product + layer1[i][j]*input[j-1];
            }
            output[i] = sigmoid(product);
        }
        //second layer
        //the output array becomes the input to our output layer
        double[] output2 = new double[layer2.length];
        //calculates the output for each output node
        for(int i=0;i<layer2.length;i++){
            product = layer2[i][0];
            for(int j=1;j<layer2[i].length;j++){
                product = product + layer2[i][j]*output[j-1];
            }
            output2[i] = Math.exp(product);
        }
        return output2;
    }

    private int getMax(double[] prob){
        double max = prob[0];
        int best = 0;
        for(int i=1;i<prob.length;i++){
            if(prob[i]>max){
                max = prob[i];
                best = i;
            }
        }
        return best;
    }
